import React, { useState, useEffect, useCallback } from 'react';
import axios from 'axios';
import { useNavigate, useParams } from 'react-router-dom';

function ExamSelection() {
    const { courseId } = useParams(); // URLÏóêÏÑú courseId Í∞ÄÏ†∏Ïò§Í∏∞
    console.log("Fetched courseId:", courseId); // courseId ÌôïÏù∏

    const [examId, setExamId] = useState(""); // Ï¥àÍ∏∞Í∞íÏùÑ Îπà Î¨∏ÏûêÏó¥Î°ú ÏÑ§Ï†ï
    const [exams, setExams] = useState([]);
    const [questions, setQuestions] = useState([]); // Î¨∏Ï†ú Î™©Î°ù ÏÉÅÌÉú Ï∂îÍ∞Ä
    const [loading, setLoading] = useState(true);
    const token = localStorage.getItem("token");
    const navigate = useNavigate();

    const fetchExams = useCallback(async () => {
        console.log("ÏãúÌóò Î™©Î°ù ÏöîÏ≤≠ Ï§ë... courseId:", courseId); // courseId ÌôïÏù∏
        if (!token) {
            console.error("Î°úÍ∑∏Ïù∏Ïù¥ ÌïÑÏöîÌï©ÎãàÎã§.");
            setLoading(false);
            return;
        }

        try {
            const response = await axios.get(`http://localhost:8090/api/courses/${courseId}/exams`, {
                headers: { Authorization: `Bearer ${token}` }
            });

            console.log("ÏãúÌóò Î™©Î°ù ÏùëÎãµ:", response.data);
            setExams(response.data); // ÏùëÎãµ Îç∞Ïù¥ÌÑ∞Î•º Í∑∏ÎåÄÎ°ú ÏÇ¨Ïö©
        } catch (error) {
            console.error("ÏãúÌóò Î™©Î°ù Î∂àÎü¨Ïò§Í∏∞ Ïò§Î•ò:", error.response ? error.response.data : error.message);
        } finally {
            setLoading(false);
        }
    }, [courseId, token]);

    useEffect(() => {
        fetchExams();
    }, [fetchExams]);

    // ÏÑ†ÌÉùÎêú ÏãúÌóòÏùò Î¨∏Ï†ú Î™©Î°ù Í∞ÄÏ†∏Ïò§Í∏∞
    const fetchQuestions = useCallback(async (examId) => {
        if (!examId) return;

        try {
            const response = await axios.get(`http://localhost:8090/api/exams/${examId}/questions`, {
                headers: { Authorization: `Bearer ${token}` }
            });
            console.log("Î¨∏Ï†ú Î™©Î°ù ÏùëÎãµ:", response.data);
            setQuestions(response.data); // Î¨∏Ï†ú Î™©Î°ù ÏÉÅÌÉú ÏóÖÎç∞Ïù¥Ìä∏
        } catch (error) {
            console.error("Î¨∏Ï†ú Î™©Î°ù Î∂àÎü¨Ïò§Í∏∞ Ïò§Î•ò:", error.response ? error.response.data : error.message);
        }
    }, [token]);

    const handleExamChange = (e) => {
        const selectedExamId = e.target.value;
        console.log("ÏÑ†ÌÉùÎêú ÏãúÌóò ID:", selectedExamId); // Ï∂îÍ∞ÄÎêú Î°úÍ∑∏
        setExamId(selectedExamId); // ÏÑ†ÌÉùÎêú ÏãúÌóò ID ÏóÖÎç∞Ïù¥Ìä∏
        fetchQuestions(selectedExamId); // Î¨∏Ï†ú Î™©Î°ù Í∞ÄÏ†∏Ïò§Í∏∞
    };

    const handleStartQuiz = () => {
        if (examId) {
            navigate(`/courses/${courseId}/quiz/${examId}`); // ÌÄ¥Ï¶à ÏãúÏûë ÌéòÏù¥ÏßÄÎ°ú Ïù¥Îèô
        }
    };

    if (loading) return <div>üì° ÏãúÌóò Î™©Î°ù Î∂àÎü¨Ïò§Îäî Ï§ë...</div>;

    return (
        <div>
            <h2>ÏãúÌóò ÏÑ†ÌÉù</h2>
            <label htmlFor="exam-select">ÏãúÌóò ÏÑ†ÌÉù:</label>
            <select
                id="exam-select"
                value={examId} // Ï¥àÍ∏∞Í∞íÏùÑ Îπà Î¨∏ÏûêÏó¥Î°ú ÏÑ§Ï†ïÌñàÏúºÎØÄÎ°ú nullÏù¥ ÏïÑÎãå Îπà Î¨∏ÏûêÏó¥Î°ú ÏÑ§Ï†ï
                onChange={handleExamChange} // ÎìúÎ°≠Îã§Ïö¥ÏóêÏÑú ÏÑ†ÌÉùÎêú Í∞íÏùÑ examIdÏóê Ï†ÄÏû•ÌïòÍ≥† Î¨∏Ï†ú Î¶¨Ïä§Ìä∏ Í∞ÄÏ†∏Ïò§Í∏∞
            >
                <option value="">ÏãúÌóòÏùÑ ÏÑ†ÌÉùÌïòÏÑ∏Ïöî</option>
                {exams.map((exam) => (
                    <option key={exam.id} value={exam.id}>
                        {exam.title}
                    </option>
                ))}
            </select>

            <h3>Î¨∏Ï†ú Î™©Î°ù</h3>
            <ul>
                {questions.map((question) => (
                    <li key={question.id}>{question.text}</li> // Î¨∏Ï†ú ÌÖçÏä§Ìä∏Î•º Î¶¨Ïä§Ìä∏Î°ú ÌëúÏãú
                ))}
            </ul>

            <button onClick={handleStartQuiz} className="start-btn" disabled={!examId}>
                ÌÄ¥Ï¶à ÏãúÏûë
            </button>
        </div>
    );
}

export default ExamSelection;
